// reducer
export default function(state = initialState, action) {
  switch(action.type) {
    case SET_DAILY_PERCENTILES_FOR_WEEK:
      return Object.assign({}, state, {percentilesForWeek: action.percentiles})
    case SET_DAILY_PERCENTILES_FOR_YEAR:
      return Object.assign({}, state, {percentilesForYear: action.percentiles})
    default:
      return state
  }
}
